import { Link } from "react-router-dom"
import React, { useState } from 'react';

export default function LoginPage() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const handleEmailChange = (event) => {
    setEmail(event.target.value);
  };

  const handlePasswordChange = (event) => {
    setPassword(event.target.value);
  };

  const handleSendButtonClick = () => {
    // handle send button click logic here
  };

  const handleAdminLoginButtonClick = () => {
    // handle admin login button click logic here
  };

  const handleUserLoginButtonClick = () => {
    // handle user login button click logic here
  };

  return (
    <form className="login-form">
      <h2>Login</h2>
      <label htmlFor="email">Email:</label>
      <input
        type="email"
        id="email"
        value={email}
        onChange={handleEmailChange}
        required
      />
      <label htmlFor="password">Password:</label>
      <input
        type="password"
        id="password"
        value={password}
        onChange={handlePasswordChange}
        required
      />
      <div className="button-group">
        <button type="button" onClick={handleSendButtonClick}>
          Send
        </button>
        <button type="button" onClick={handleAdminLoginButtonClick}>
          Admin Login
        </button>
        <button type="button" onClick={handleUserLoginButtonClick}>
          User Login
        </button>
      </div>
    </form>
  );
}
